import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import Home from "./components/Home";
import Recipes from "./components/Recipes";
import Service from "./components/Service";
import Restaurants from "./components/Restaurants";
import Favorites from "./components/Favorites"; // Página de favoritos
import Cart from "./components/Cart"; // Página de carrito
import { LoginButton } from "./components/Login"; // Asegúrate de importar el LoginButton si es necesario
import { useAuth0 } from '@auth0/auth0-react'; // Importar useAuth0 para verificar el estado de autenticación

import "./App.css";

function App() {
  const { isAuthenticated } = useAuth0(); // Verificar si el usuario está autenticado

  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/recipes" element={<Recipes />} />
        <Route path="/service" element={<Service />} />
        <Route path="/restaurants" element={<Restaurants />} />
        <Route path="/favorites" element={isAuthenticated ? <Favorites /> : <LoginButton />} /> {/* Si el usuario está autenticado, se muestra favoritos, si no, se muestra el LoginButton */}
        <Route path="/cart" element={isAuthenticated ? <Cart /> : <LoginButton />} /> {/* Si el usuario está autenticado, se muestra el carrito, si no, se muestra el LoginButton */}
      </Routes>
    </Router>
  );
}

export default App;
